@Component({
  selector: 'app-profile',
  templateUrl: './profile.component.html',
  styleUrls: ['./profile.component.css']
})
export class ProfileComponent {

}
<div class="body">
    <div class="profile-body">
        <div class="left">
            <img id="profile-picture" src="assets\images\fortnite_x_travis_scott.jpg" alt="Profile Picture">
        </div>
        <div class="right">

        </div>
    </div>
</div>
